svg:
>



	xmlns="http://www.w3.org/2000/svg"
	xlink="http://www.w3.org/1999/xlink"
	var Doc;
	var O;
	var Root
	var count=0
	var pair=[]
	var TriObj=[]
	var w=100
	a=w*Math.sqrt(3).toString().substring(0,8)/2
	var R
	var M
function startup(evt){
	O=evt.target
	Doc=document
	Root=document.documentElement
	O.setAttribute("onclick","ClickPoint(evt)")

	pair[0]=[0,3,1,4,2,5] //three crossings
	pair[1]=[0,2,1,4,3,5] //two crossings
	pair[2]=[0,5,1,3,2,4] //one crossing
	pair[3]=[0,4,1,5,2,3] //one crossing
	pair[4]=[0,5,1,4,2,3] //no crossings
	pair[5]=[0,5,1,2,3,4] //three corners
	pair[6]=[0,1,2,3,4,5] //three sides
	pair[7]=[0,4,1,3,2,5] //rotation of 1
	pair[8]=[0,3,1,5,2,4] //rotation of 1
	pair[9]=[0,2,1,5,3,4] //rotation of 2
	pair[10]=[0,4,1,2,3,5] //rotation of 2
	pair[11]=[0,1,2,4,3,5] //rotation of 3
	pair[12]=[0,2,1,3,4,5] //rotation of 3
	pair[13]=[0,1,2,5,3,4] //rotation of 4
	pair[14]=[0,3,1,2,4,5] //rotation of 4
	R=getRect()

	for (var j=0;j<R.y/a;j++){
	for (var i=0;i<R.x/w+1;i++){
		var cr=(j%2+1)*.5
		var Q1={x:(i-cr)*w,y:(a)*(j+1)}
		var Q2={x:(i+1 - cr)*w,y:(a)*(j+1)}
		var Q3={x:(i+.5 - cr)*w,y:a*j}
		var Tri=[Q1,Q2,Q3]
		var r=Math.floor(Math.random()*pair.length)
	  //r=(i+j)%pair.length
		TriObj[count]={num:count,path:r}
		tileMake(Tri,pair[r],count++)
		var Q1={x:(i+.5 - cr)*w,y:a*j}
		var Q2={x:(i+1.5 - cr)*w,y:a*j}
		var Q3={x:(i+1 - cr)*w,y:(a)*(j+1)}
		var Tri=[Q1,Q2,Q3]
		var r=Math.floor(Math.random()*pair.length)
		TriObj[count]={num:count,path:r}
		tileMake(Tri,pair[r],count++)

	}
	}
	var E=document.getElementById("E")
	Root.removeChild(E)
	Root.appendChild(E)
	var r=Math.floor(Math.random()*count)
	document.getElementById("M").setAttributeNS(xlink,"xlink:href","#B"+r+":0")
	document.getElementById("AM").beginElement();
}
function tileMake(Tri, pairs,id){
	TL=Tri.length
	var P=document.createElementNS(xmlns,"path")
	P.setAttribute("d","M "+Tri[0].x+" "+Tri[0].y+" "+Tri[1].x+" "+Tri[1].y+" "+Tri[2].x+" "+Tri[2].y)
	//P.setAttribute("fill",Color())
	if (Math.random()<.5) P.setAttribute("fill","#244")
	//else if (id%5==1) P.setAttribute("fill","#6b6")
	//else if (id%5==2) P.setAttribute("fill","#dff")
	//else if (id%5==3) P.setAttribute("fill","#aa8")
	else P.setAttribute("fill","#335")
	//else P.setAttribute("fill","url(#g)")
	P.setAttribute("opacity",.55)
	P.setAttribute("class","triangle")
	P.setAttribute("id","T"+id)
	Root.appendChild(P)
	var L=new Array(6)
	var Sum={x:0,y:0}
	for (i=0;i<TL;i++) {
		k=(i+TL-1)%TL
		L[2*i]={x:(2*Tri[k].x+Tri[i].x)/3,y:(2*Tri[k].y+Tri[i].y)/3}
		L[2*i+1]={x:(Tri[k].x+2*Tri[i].x)/3,y:(Tri[k].y+2*Tri[i].y)/3}
		Sum.x+=Tri[i].x; Sum.y+=Tri[i].y
	}
	var Center={x:Sum.x/TL,y:Sum.y/TL}
	var C=new Array()
	for (var i=0;i<TL;i++){
		var px=(Tri[i].x+2*Center.x)/3
		var py=(Tri[i].y+2*Center.y)/3
		C[i]={x:px,y:py}
	}
	M=new Array(2,0,0,1,1,2) //1&2 -> 0; 3&4 -> 1; &0 -> 2
	for (var i=0;i<TL;i++){
		var p1=pairs[2*i]
		var p2=pairs[2*i+1]
		drawbezier(L[p1],C[M[p1]],C[M[p2]],L[p2],"#600","B"+id+":"+i)
	}
}

function drawbezier(P1,C1,C2,P2,c,id){
	var L=Doc.createElementNS(xmlns,"path")
	if (c==null) c="yellow"
	var lineAtts=["d","stroke","stroke-width","fill","id"]
	var s="M "+P1.x+" "+P1.y+" "+"C "+C1.x+" "+C1.y+" "+C2.x+" "+C2.y+" "+P2.x+" "+P2.y
	var Lvalues=[s,c,2,"none",id]
	for (var j in Lvalues) L.setAttribute(lineAtts[j],Lvalues[j])
	O.appendChild(L)
}
function assignAttr(O,A){
	for (var i in A) O.setAttributeNS(null,i, A[i])
}
function ClickPoint(evt){
	O=evt.target
	if (O.getAttribute("class")=="triangle") {
		var id=O.getAttribute("id").replace("T","")
		var n=Math.floor(Math.random()*3)
		O=document.getElementById("B"+id+":"+n)
		id="B"+id+":"+n
	}
	O.setAttribute("stroke","red")
	document.getElementById("M").setAttributeNS(xlink,"xlink:href","#"+O.id)
	document.getElementById("AM").beginElement();
}
function stopit(evt){
	var FN=evt.target.firstChild
	var H=FN.attributes.item(1).nodeValue
	var M=document.getElementById("M")
	//try{var H=evt.target.firstChild.getAttribute("xlink:href")}
	//catch(err){H=evt.target.firstChild.getAttributeNS(xlink,"xlink:href")}
	//try{var H=M.getAttribute("xlink:href")}
	//catch(err){M.getAttributeNS(xlink,"xlink:href")}
	//alert(H)
	var CN=H.replace("#B","").split(":")
	var r=parseInt(CN[0])
	var n=CN[1]
	id="B"+r+":"+n
	if(Math.random()<.5)
		document.getElementById(id).setAttributeNS(null,"stroke","#600")
	else 
		document.getElementById(id).setAttributeNS(null,"stroke","#015")
	var first=pair[TriObj[r].path][n*2]
	var last=pair[TriObj[r].path][n*2+1]
	//alert(first+":"+pair[TriObj[r].path]+":"+last)
	var perrow=Math.floor(2*(R.x/w+1))
	var	row=Math.floor(r/perrow)
	var nrows= Math.ceil(R.y/a)
	var ntiles=nrows*perrow
	if (Math.floor(last/2)==0) next=r-1
	else if (Math.floor(last/2)==1) {
		if (r%2==0) {
			next=r+perrow+2*((row+1)%2)
			if (next>ntiles-1) next=r%perrow

		}
		else {
			next=r-perrow-2*((row)%2)
			if (row==0) next=r+(nrows-1)*perrow//bounce
			if (next<0) next=0
		}
	}
	else {
		next=(r+1)
	}
	if ((next<0)||(next>ntiles-1)) next=Math.floor(Math.random()*ntiles)
	var Tid="T"+next
	var n=Math.floor(Math.random()*3)
	var Bid="B"+next+":"+n
	try{
		if (document.getElementById(Tid).getAttribute("fill")=="#335")
		document.getElementById(Tid).setAttributeNS(null,"fill","#244")
		else document.getElementById(Tid).setAttributeNS(null,"fill","#335")
		document.getElementById(Bid).setAttributeNS(null,"stroke","#ef8")
		M.setAttributeNS(xlink,"xlink:href","#"+Bid)
		document.getElementById("AM").beginElement();
	}
	catch(err){alert("next:"+next+": ntiles="+ntiles+":r="+r+". perrow="+perrow)}

}
function getRect(rect){
	try{ rect={x: Root.viewport.width,y:Root.viewport.height} }
	catch(e){rect={x: window.innerWidth,y:window.innerHeight}}
	return rect
}
function Color(){
	var r=parseInt(150+Math.random()*105)
	var g=parseInt(150+Math.random()*105)
	var b=parseInt(150+Math.random()*105)
	return "rgb("+r+","+g+","+b+")";
}
